sion in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Hvis din webshop har adresse i EU, anbefaler vi at bruge EU-momsnummerudvidelsen som tilføjelse til automatisk moms. Det giver mulighed for, at du på siden Kasse kan indsætte et indtastningsfelt for at indsamle og validere kunders EU-momsnummer, hvis de har et.','Get real-time order alerts anywhere'=>'Få besked om ordrer overalt i realtid','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Få notifikationer om aktivitet i webshoppen, herunder nye ordrer og vareanmeldelser direkte på dine mobile enheder med Woo-appen.','First order received'=>'Første ordre er modtaget','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Denne videoguide vil hjælpe dig igennem processen med at tilføje din første vare i WooCommerce.','Do you need help with adding your first product?'=>'Har du brug for hjælp med at tilføje din første vare?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'At starte en modewebshop er spændende, men kan samtidig synes som et stort arbejde. I denne artikel vil vi gennemgå opsætningsprocessen, lære dig at oprette succesfulde varevisninger, og vise dig, hvordan du markedsfører din varer til den rette målgruppe.','Start your online clothing store'=>'Start din webshop med tøj','The admin note layout has a wrong prop value.'=>'Admin-notatets layout har en forkert nøgleværdi.','Watch tutorial'=>'Se guide','Share feedback'=>'Del feedback','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your