ess:'=>'Direkte betalinger til e-mailadresse:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Sikker accept af kreditkort og debetkort med en lav rente, ingen overraskende gebyrer (mulighed for tilpasset rente). Sælg online og i butik og find dine oplysninger om salg og lager på ét og samme sted <a href="%s" target="_blank">Få mere information om Square</a>.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Vælg den betaling, som du ønsker. Betal nu, betal senere eller del betalingen op i flere dele. Ingen kreditkortnumre, ingen adgangskoder, ingen bekymringer. <a href="%s" target="_blank">Få mere information om Klarna</a>.','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Fuldkommen betalingsoplevelse. Betal nu, betal senere eller del betalingen op i flere dele. Ingen kreditkortnumre, ingen adgangskoder, ingen bekymringer. <a href="%s" target="_blank">Få mere information om Klarna</a>. ','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Accepter debetkort og kreditkort i 135+ valutaer, betalingsmetoder såsom Alipay, og et-klik betaling med Apple Pay. <a href="%s" target="_blank">Mere info her</a>.','I will also be selling products or services in person.'=>'Jeg sælger også varer og services ved personligt salg.','Customer downloads'=>'Kunde downloads','Revision restored.'=>'Revision genskabt.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your produc